import React, { useState } from "react";
import "./Login.module.css"; 

function HomePage({ onLogout }) {
  const [activeTab, setActiveTab] = useState("Servers");

  const renderContent = () => {
    switch (activeTab) {
      case "Servers":
        return <p>Server management tools and list go here.</p>;
      case "Zones":
        return <p>Zone management section.</p>;
      case "Server Statistics":
        return <p>Performance graphs and metrics appear here.</p>;
      default:
        return null;
    }
  };

  return (
    <div className="container">
      <div className="card" style={{ width: "100%", maxWidth: "800px" }}>
        {/* Header Bar */}
        <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
          <div style={{ display: "flex", alignItems: "center", gap: "8px" }}>
            <span role="img" aria-label="home">üè†</span>
            <a href="/" style={{ textDecoration: "none", color: "#4a78ff", fontWeight: "600" }}>
              Home
            </a>
          </div>

          <button className="button" onClick={onLogout}>
            Logout
          </button>
        </div>

        {/* Tabs */}
        <div style={{ marginTop: "24px" }}>
          <div
            style={{
              display: "flex",
              justifyContent: "space-around",
              borderBottom: "1px solid #ddd",
              marginBottom: "16px",
            }}
          >
            {["Servers", "Zones", "Server Statistics"].map((tab) => (
              <button
                key={tab}
                onClick={() => setActiveTab(tab)}
                style={{
                  background: "none",
                  border: "none",
                  padding: "12px 16px",
                  fontWeight: activeTab === tab ? "600" : "500",
                  color: activeTab === tab ? "#4a78ff" : "#333",
                  borderBottom: activeTab === tab ? "3px solid #4a78ff" : "3px solid transparent",
                  cursor: "pointer",
                }}
              >
                {tab}
              </button>
            ))}
          </div>

          {/* Content */}
          <div style={{ padding: "16px" }}>
            {renderContent()}
          </div>
        </div>
      </div>
    </div>
  );
}

export default HomePage;
